import React, { Component } from 'react';
import { withStyles, Button, Card, CardActions } from '@material-ui/core';
import CssBaseline from '@material-ui/core/CssBaseline';
// import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Container from '@material-ui/core/Container';
import clsx from 'clsx';

import style from './style';
import { Header, Footer } from 'Components';

const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];

const backgroundImage =
  'https://images.unsplash.com/photo-1534854638093-bada1813ca19?auto=format&fit=crop&w=1400&q=80';

class Layout extends Component {
  render() {
    const { classes, backgroundClassName, children } = this.props;

    return (
      <div className={classes.container}>
        <Header />
        <CssBaseline />
        <Container maxWidth='lg'>
          <main>
            <section className={classes.root}>
              <Container className={classes.container}>
                <img
                  src='https://www.travelplusstyle.com/wp-content/uploads/2016/01/sonevajani-1880.jpg'
                  alt='wonder'
                  width='1300'
                  height='80'
                />
                {children}
                <div className={classes.backdrop} />
                <div
                  className={clsx(classes.background, backgroundClassName)}
                />
                <img
                  className={classes.arrowDown}
                  src='https://www.travelplusstyle.com/wp-content/uploads/2016/01/sonevajani-1880.jpg'
                  height='16'
                  width='12'
                  alt='arrow down'
                />
              </Container>
            </section>
            {/* <Paper className={classes.mainFeaturedPost}>
              {
                <img
                  style={{ display: 'none' }}
                  src='https://source.unsplash.com/user/erondu'
                  alt='background'
                />
              }
              <div className={classes.overlay} />
              <Grid container>
                <Grid item md={12}>
                  <div className={classes.mainFeaturedPostContent}>
                    <Typography
                      component='h1'
                      variant='h3'
                      color='inherit'
                      gutterBottom
                    >
                      Welcome To StayIN
                    </Typography>
                    <Button
                      variant='contained'
                      color='primary'
                      className={classes.button}
                    >
                      Login
                    </Button>
                    <Button
                      variant='contained'
                      color='primary'
                      className={classes.button}
                    >
                      SignUp
                    </Button>
                  </div>
                </Grid>
              </Grid>
            </Paper> */}

            <Container className={classes.cardGrid} maxWidth='md'>
              {/* End hero unit */}
              <Grid container spacing={4}>
                {cards.map(card => (
                  <Grid item key={card} xs={12} sm={6} md={4}>
                    <Card className={classes.card}>
                      <CardMedia
                        className={classes.cardMedia}
                        image='https://source.unsplash.com/random'
                        title='Image title'
                      />
                      <CardContent className={classes.cardContent}>
                        <Typography gutterBottom variant='h5' component='h2'>
                          Heading
                        </Typography>
                        <Typography>
                          This is a media card. You can use this section to
                          describe the content.
                        </Typography>
                      </CardContent>
                      <CardActions>
                        <Button size='small' color='primary'>
                          View
                        </Button>
                        <Button size='small' color='primary'>
                          Edit
                        </Button>
                      </CardActions>
                    </Card>
                  </Grid>
                ))}
              </Grid>
            </Container>
          </main>
        </Container>
        <Footer />
      </div>
    );
  }
}

export default withStyles(style)(Layout);
